import React, { Component } from 'react'
import logo from '../logo.svg';
import PriceList from '../components/PriceList'
import ViewTab from '../components/ViewTab'
import { LIST_VIEW, CHART_VIEW } from '../utility'
import MonthPicker from '../components/MonthPicker'

const items = [
    {
      "id": 1,
      "title": "去青甘旅游",
      "price": 200, 
      "data": "2019-09-10",
      "category": {
        "id": "1",
        "name": "旅行",
        "type": "outcome",
        "iconName": "ios-plane"
      }
    },
    {
      "id": 2,
      "title": "去上海旅游",
      "price": 400, 
      "data": "2019-09-10",
      "category": {
        "id": "1",
        "name": "旅行",
        "type": "outcome",
        "iconName": "ios-plane"
      }
    },
    {
      "id": 3,
      "title": "理财收入",
      "price": 200, 
      "data": "2019-09-10",
      "category": {
        "id": "2",
        "name": "理财",
        "type": "income",
        "iconName": "logo-yen"
      }
    }
  ]

class Home extends Component {
    render() {
        return (
            <React.Fragment>
                <header className="App-header">
                    <div className="row mb-5">
                        <img src={logo} className="App-logo" alt="logo" />
                    </div>
                    <div className="row">
                        <div className="col">
                            <MonthPicker 
                                year={2020}
                                month={8}
                                onChang
                            />
                        </div>
                        <div className="col">

                        </div>
                    </div>
                </header>                
            </React.Fragment>
        )
    }
}

export default Home
